    `},"liturgia-horas":{title:"Liturgia das Horas",content:"<p>A orao oficial da Igreja, santificando cada momento do dia.</p><br><p><strong>Ofcio das Leituras:</strong> Leituras bblicas e patrsticas (qualquer hora)</p><p><strong>Laudes:</strong> Orao da aurora</p><p><strong>Hora Mdia:</strong> Trcia (9h), Sexta (12h) ou Noa (15h)</p><p><strong>Vsperas:</strong> Orao do entardecer</p><p><strong>Completas:</strong> Orao antes de dormir</p><br><p>A Liturgia das Horas une toda a Igreja em orao contnua, formando um s coro que louva a Deus sem cessar.</p>"},"pai-nosso":{title:"Pai Nosso",content:'<p style="text-align: center; font-size: 18px; line-height: 1.8;">Pai nosso que estais nos Cus,<br>santificado seja o vosso Nome,<br>venha a ns o vosso Reino,<br>seja feita a vossa vontade<br>assim na terra como no Cu.<br><br>O po nosso de cada dia nos dai hoje,<br>perdoai-nos as nossas ofensas<br>assim como ns perdoamos<br>a quem nos tem ofendido,<br>e no nos deixeis cair em tentao,<br>mas livrai-nos do Mal.<br><br><strong>Amm.</strong></p>'},"ave-maria":{title:"Ave Maria",content:'<p style="text-align: center; font-size: 18px; line-height: 1.8;">Ave Maria, cheia de graa,<br>o Senhor  convosco,<br>bendita sois vs entre as mulheres<br>e bendito  o fruto do vosso ventre, Jesus.<br><br>Santa Maria, Me de Deus,<br>rogai por ns pecadores,<br>agora e na hora da nossa morte.<br><br><strong>Amm.</strong></p>'},gloria:{title:"Glria ao Pai",content:'<p style="text-align: center; font-size: 18px; line-height: 1.8;">Glria ao Pai, e ao Filho,<br>e ao Esprito Santo.<br><br>Assim como era no princpio,<br>agora e sempre<br>e pelos sculos dos sculos.<br><br><strong>Amm.</strong></p>'},credo:{title:"Credo Apostlico",content:'<p style="text-align: center; font-size: 16px; line-height: 1.8;">Creio em Deus Pai, Todo-Poderoso, Criador do Cu e da terra.<br><br>E em Jesus Cristo, seu nico Filho, Nosso Senhor, que foi concebido pelo poder do Esprito Santo, nasceu da Virgem Maria, padeceu sob Pncio Pilatos, foi crucificado, morto e sepultado, desceu  manso dos mortos, ressuscitou ao terceiro dia, subiu aos Cus, est sentado  direita de Deus Pai Todo-Poderoso, donde h de vir a julgar os vivos e os mortos.<br><br>Creio no Esprito Santo, na Santa Igreja Catlica, na comunho dos Santos, na remisso dos pecados, na ressurreio da carne, na vida eterna.<br><br><strong>Amm.</strong></p>'},"ato-contricao":{title:"Ato de Contrio",content:'<p style="text-align: center; font-size: 18px; line-height: 1.8;">Meu Deus, eu me arrependo de todo o corao de Vos ter ofendido, porque sois infinitamente bom e o pecado Vos desagrada.<br><br>Proponho firmemente, com o auxlio da vossa graa, fazer penitncia, no mais pecar e fugir das ocasies de pecado.<br><br><strong>Amm.</strong></p>'},"salve-rainha":{title:"Salve Rainha",content:'<p style="text-align: center; font-size: 16px; line-height: 1.8;">Salve, Rainha, Me de misericrdia, vida, doura e esperana nossa, salve!<br><br>A vs bradamos, os degredados filhos de Eva. A vs suspiramos, gemendo e chorando neste vale de lgrimas.<br><br>Eia, pois, advogada nossa, esses vossos olhos misericordiosos a ns volvei, e depois deste desterro mostrai-nos Jesus, bendito fruto do vosso ventre.<br><br> clemente,  piedosa,  doce sempre Virgem Maria.<br><br><em>V. Rogai por ns, Santa Me de Deus.</em><br><em>R. Para que sejamos dignos das promessas de Cristo. Amm.</em></p>'},share:{title:"Compartilhar a Campanha",content:`
